import React from 'react';
import "../Style_Components/Button.css"
import { Link } from 'react-router-dom';
const Button = (props) => {
    return (
      <Link className=' mr-20 mt-20'  to={props.go_to} ><button >{props.name}</button></Link>
    );
};

export default Button;
